const d=document,menuDeletePxj=d.querySelectorAll("#delete button");menuDeletePxj.forEach(e=>{e.addEventListener("click",n=>{d.querySelector("#id_planning_del").value=e.value,d.querySelector("#delete").classList.add("d-none"),d.querySelector("#del_joueur").classList.remove("d-none")})});const menuDeletePxjJoueur=d.querySelectorAll("#view_joueurs_del button");menuDeletePxjJoueur.forEach(e=>{e.addEventListener("click",n=>{fetch("/",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({pxj_del_joueur_id:e.value,pxj_del_planning_id:d.querySelector("#id_planning_del").value})}).then(e=>e.json()).then(n=>{e.classList.add("d-none")})})});